class ProductResponseDto extends ProductResponseEntity {
  ProductResponseDto({
    this.message,
    super.clothes,
  });

  ProductResponseDto.fromJson(dynamic json) {
    message = json['message'];
    if (json['Clothes'] != null) {
      clothes = [];
      json['Clothes'].forEach((v) {
        clothes?.add(ProductDto.fromJson(v));
      });
    }
  }

  String? message;
}

