class ProductDto extends ProductEntity {
  ProductDto({
    super.id,
    super.name,
    super.category,
    super.price,
    super.imageUrl,
    super.description,
  });

  ProductDto.fromJson(dynamic json) {
    id = json['id'];
    name = json['Name'];
    category = json['Category'];
    price = json['Price'];
    imageUrl = json['imageUrl'];
    description = json['Description'];
  }
}
